def captcha(nonce):
    # Just not to solve captcha manually
    # You can solve it using go
    return hmac.new(
        b"d528291b1e8e61b84389760fce409faf9c4be2c3",
        nonce.encode(),
        hashlib.sha1).hexdigest()

